import React from 'react';

const RankTable = (rankList) => {
    let showList = []
    if(rankList !== undefined){
        console.log(rankList)
        console.log(typeof(rankList))
        for(let i=0; i < 10; i++){
            let str = rankList[i].username + " : " + rankList[i].reactTime_Best
        showList.push(str)
        }
    }

    return (
       <ol>
           {showList}
       </ol>
    )
};

export default RankTable
